import './App.css';
import Header from './components/Header';
import AddStudent from './components/AddStudent';
import {BrowserRouter as Router,Routes, Route} from "react-router-dom"; 

function App() {
  return (

      <div> 
        <Header/>
        <Routes>
          <Route path="/add" exact component = {AddStudent}/>
        </Routes>

      </div>


  );
}

export default App;
